import React from "react";
import "./testhover.css";

const datas = [
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition:
      "TheNFS2-640intelligentFireAlarmControlPanelispartofthe ONYX® Series of Fire Alarm Controls from NOTIFIER.",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "TestDecritio",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "TestDecritio",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "TestDecritio",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "TestDecritio",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "TestDecritio",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "dddddddddddddddddddd",
    href: "/",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "TestDecritionsssssss",
    href: "/",
  },
  {
    img: "https://i.loli.net/2019/10/18/buDT4YS6zUMfHst.jpg",
    alt: "Sora",
    title: "test1",
    decrition: "TestDecritionsssssss",
    href: "/",
  },
];

export default function Testhover() {
  return (
    <div className="item-containers">
      <div className="container">
        {datas.map(function (data, i) {
          return (
            <div className="card">
              <img src={data.img} alt={data.alt} className="card-img-top" />
              <div className="card-body">
                <h5 className="card-title">{data.title}</h5>
                <p className="card-text">{data.decrition}</p>
                <a href={data.href} className="btn">
                  More
                </a>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}
